function addDelayedWalker(timeout) {
    setTimeout(function() {
        console.log("census rescan");
        var foundNode = nativeTreeWalker();
        foundNode= false;
        if (!foundNode) {
            setTimeout(function() {
                if (DEBUG) console.log("census rescan");
                nativeTreeWalker();
            }, 4000);
        }
    }, (timeout ? timeout : 2000));

}
function nativeTreeWalker() {
    var walker = document.createTreeWalker(
        document.body,
        NodeFilter.SHOW_ELEMENT,
        null,
        false
    );

    var node;
    var zipCodeNodes = [];


    while(node = walker.nextNode()) {
       //CARLDEBUG


        if (!node.parentNode || !node.innerText) continue;
        // if only one child, and that child is not a text node, then bail
        if (node.childNodes && node.childNodes.length == 1  && node.childNodes[0].nodeType !=  Node.TEXT_NODE) continue;



        var childWalker = document.createTreeWalker(node, NodeFilter.SHOW_ELEMENT,null, false);
        var childIsElement = false;

        while(child = childWalker.nextNode()) {
            if (child.nodeType == Node.ELEMENT_NODE && child.nodeName.toLowerCase() != 'br' && child.nodeName.toLowerCase() != 'b') {
                childIsElement = true;
                break;
            }
        }

        //WALKER exceptions
        if (extractHostname(document.location.href) == "matrix.brightmls.com"  &&  node.classList.contains("J_formula") ) {
            childIsElement = false;
        }
        if (extractHostname(document.location.href) == "www.realtor.com" && node.parentNode && node.parentNode.id == "ldp-address")  {
            childIsElement = false;
        }
        if (extractHostname(document.location.href) == "www.apartments.com" &&  node.classList.contains("stateZipContainer"))  {
            childIsElement = false;
        }


        if (childIsElement) {
            if (specialTreatmentUrls.includes(extractHostname(document.location.href))) {
                // if we have a scrollable node, let's attach a listener, so we can rerun our scan
                if (!node.classList.contains("census_rendered") && (node.scrollHeight - node.clientHeight)>1000) {
                    addDebounceScrollListeners(node);
                    if (DEBUG) console.log("OVERFLOW NODE!!"+ node.id + "|" + (node.scrollHeight-node.clientHeight));
                }
            }

            continue; // if we have ELEMENT node childen, bauil
        }

        if (node.classList.contains("census_rendered") && node.innerHTML.indexOf("censusconnectel")!=-1) continue;// if we have already processed this node, bail


        //var text= node.nodeValue;
        var text= node.innerText;

        const found = text.match(zipRegex);

        //if (node.classList.contains("stateZipContainer")) console.log('found' + found + ":" + text)
        if (found) {

            var stateZip = found[0];



            var state = stateZip.replace(/\s\d{5}/, '').trim();

            // validState
            var validState = true;
            if (state.length == 2 && state.toUpperCase()!=state) validState = false;
            if (validState) {

                var isAState = state.toUpperCase().match(/AL|ALABAMA|AK|ALASKA|AZ|ARIZONA|AR|ARKANSAS|CA|CALIFORNIA|CZ|CANAL ZONE|CO|COLORADO|CT|CONNECTICUT|DE|DELAWARE|DC|DISTRICT OF COLUMBIA|FL|FLORIDA|GA|GEORGIA|GU|GUAM|HI|HAWAII|ID|IDAHO|IL|ILLINOIS|IN|INDIANA|IA|IOWA|KS|KANSAS|KY|KENTUCKY|LA|LOUISIANA|ME|MAINE|MD|MARYLAND|MA|MASSACHUSETTS|MI|MICHIGAN|MN|MINNESOTA|MS|MISSISSIPPI|MO|MISSOURI|MT|MONTANA|NE|NEBRASKA|NV|NEVADA|NH|NEW HAMPSHIRE|NJ|NEW JERSEY|NM|NEW MEXICO|NY|NEW YORK|NC|NORTH CAROLINA|ND|NORTH DAKOTA|OH|OHIO|OK|OKLAHOMA|OR|OREGON|PA|PENNSYLVANIA|PR|PUERTO RICO|RI|RHODE ISLAND|SC|SOUTH CAROLINA|SD|SOUTH DAKOTA|TN|TENNESSEE|TX|TEXAS|UT|UTAH|VT|VERMONT|VI|VIRGIN ISLANDS|VA|VIRGINIA|WA|WASHINGTON|WV|WEST VIRGINIA|WI|WISCONSIN|WY|WYOMING/);
                if (isAState) {

                    var zipNodeAndFullAddy = findFullAddressFromZipCodeNode(node, stateZip);

                    if (zipNodeAndFullAddy) {

                        zipCodeNodes.push(node.nodeValue);
                    }


                }
            }


            //console.log(node.nodeValue);
            //console.log(found)
        }


    }
    return zipCodeNodes.length>0;
}
/* we have identified that this is the zipcode node, e.g. at least has: MD 21045
Now want to walk the rest of the String to see if it looks like City.. or full address.. if not full address, need to look elsewhere
*/
var streetAddyRegex = /^(\d+\s+|\d+\/\d+\s+|\d+\s*&\s*\d+\s+|\d+-\d+\s+)\w+(\s|$)/;
// (\d+\s+|\d+-\d+\s+): deals w/ 2230-2232 N 5th street scenario as well as normal 2230 N 5th street
var LARGEST_STREET_ADDY_SIZE = 120;
function findFullAddressFromZipCodeNode(zipNode, stateZip) {

    var foundFullAddy = false;
    var fullAddy = null;

    var text= zipNode.innerText.replace(stateZip, '');

    if (text.match(streetAddyRegex) && text.length<LARGEST_STREET_ADDY_SIZE) {
        var addy = text + stateZip;

        if (foundAddress(zipNode, addy, null, stateZip)) {
            fullAddy = addy;
            foundFullAddy = true;
        }



    }

    if (!foundFullAddy) {

        // we need to search else where for the Street Number + Street Address portion
        // search previous
        var nd = zipNode;
        fullAddy = checkNodes(zipNode, nd, 'previousSibling', stateZip);
        if (!fullAddy) fullAddy = checkNodes(zipNode, nd, 'nextSibling', stateZip);

        if (!fullAddy && nd.parentNode) fullAddy = checkNodes(zipNode, nd.parentNode, 'previousSibling', stateZip);
        if (!fullAddy && nd.parentNode) fullAddy = checkNodes(zipNode, nd.parentNode, 'nextSibling', stateZip);
        if (!fullAddy && nd.parentNode.parentNode) fullAddy = checkNodes(zipNode, nd.parentNode.parentNode, 'previousSibling', stateZip);
        if (!fullAddy && nd.parentNode.parentNode) fullAddy = checkNodes(zipNode, nd.parentNode.parentNode, 'nextSibling', stateZip);
        //console.log(node.previousSibling);
        //console.log(node.nextSibling);
    }

    // see if this line starts with a number followed by a word.. and is < 120 characters
//    var state = found[0].replace(/\s\d{5}/, '').trim();

    return fullAddy ? [zipNode, fullAddy] : null;
}
function checkNodes(zipNode, nd, direction, stateZip) {
    //console.log("zipNode: " + zipNode.innerText + "," + nd.innerHTML)
    if ((fullAddy=checkNode(zipNode, nd,  stateZip))!=null) {
        return fullAddy;
    }


    var fullAddy = null;
    while ((nd = nd[direction])!=null) {
        if ((fullAddy=checkNode(zipNode, nd,  stateZip))!=null) {
            return fullAddy;
        }
        /*var addy = nd.nodeType == Node.ELEMENT_NODE ? nd.innerText : nd.nodeType == Node.TEXT_NODE ? nd.nodeValue : null;

        if (addy && addy.match(streetAddyRegex) && addy.length<LARGEST_STREET_ADDY_SIZE) {

            fullAddy = addy + stateZip;
            if (foundAddress(zipNode, fullAddy, nd)) {
                break;
            }
        }*/
    }
    return fullAddy;
}
function checkNode(zipNode, nd,  stateZip) {
    var addy = nd.nodeType == Node.ELEMENT_NODE ? nd.innerText : nd.nodeType == Node.TEXT_NODE ? nd.nodeValue : null;

    if (addy && addy.match(streetAddyRegex) && addy.length<LARGEST_STREET_ADDY_SIZE) {

        fullAddy = addy + stateZip;
        if (foundAddress(zipNode, fullAddy, nd, stateZip)) return fullAddy;
    }
    return null;

}
