function sanitizeCensusAddress(fullAddy) {
    fullAddy = fullAddy.replace(/\r|\n|\t/g, " ");
    fullAddy = fullAddy.replace(/[^a-zA-Z0-9\s-\/]/g, "");
    return fullAddy;
}
function extractHostname(url) {
    var hostname;
    //find & remove protocol (http, ftp, etc.) and get hostname
    if (url.indexOf("//") > -1) {
        hostname = url.split('/')[2];
    }
    else {
        hostname = url.split('/')[0];
    }
    //find & remove port number
    hostname = hostname.split(':')[0];
    //find & remove "?"
    hostname = hostname.split('?')[0];
    return hostname;
}

function addDebounceScrollListeners(node, isWindow) {
    if (!isWindow) node.classList.add("census_rendered");
    if (DEBUG) console.log("called addscroll");
    function debounce(method, delay) {
        clearTimeout(method._tId);
        method._tId= setTimeout(function(){
            method();
        }, delay);
    }
    //var scrollElId = extractHostname(document.location.href) == 'www.zillow.com' ? "search-page-list-container" : null;

    var fn = function(e) {
        debounce(handleScroll, 400);
    };
    if (isWindow) {
        window.onscroll = fn;
    } else {
        node.addEventListener('scroll', fn);
    }


}
function handleScroll() {
    if (DEBUG) console.log("handleScroll");
    nativeTreeWalker()
}
function addDomElementObserver(targetNode, callback) {
    // Select the node that will be observed for mutations


    // Options for the observer (which mutations to observe)
    const config = { attributes: true, childList: false, subtree: true };

    // Callback function to execute when mutations are observed
    //const callback = function(mutationsList, observer) {
        // Use traditional 'for loops' for IE 11
        /*for(const mutation of mutationsList) {
            if (mutation.type === 'childList') {
                console.log('A child node has been added or removed.');
            }
            else if (mutation.type === 'attributes') {
                console.log('The ' + mutation.attributeName + ' attribute was modified.');
            }
        }*/
    //};

    // Create an observer instance linked to the callback function
    const observer = new MutationObserver(callback);

    // Start observing the target node for configured mutations

    observer.observe(targetNode, config);
}

